import React from "react";
import { Switch, Route } from "react-router-dom";
import Page from "./Page";
function MainApp() {
  return (
    <div className="mainApp">
      <Switch>
        <Route
          path="/"
          component={() => {
            return <Page pageName="Home" />;
          }}
        />
        <Route
          path="/about"
          component={() => {
            return <Page pageName="About" />;
          }}
        />
      </Switch>
    </div>
  );
}

export default MainApp;
